import React from 'react';

import './List.css'
import ListItem from '../ListItem/ListItem';

const List = ({items}) => {

    console.log(items)
    return (
        <div className="list">
            {/* <h5>{this.props.listName} ></h5> */}
            <div class="listItems">
                { items && items.map(item => {
                    return(
                        <ListItem item={item} key={item.id}/>
                    )
                })}
                <ListItem image={items.image} 
                name={items.name}
                price={items.price} />
            </div>
        </div>
    )
}

export default List;
